import React, { Component } from "react";
import Header from "./components/header.jsx";
import NavBar from "./components/navBar.jsx";
import StudentInfo from "./components/studentInfo.jsx";
import Footer from "./components/footer.jsx";

class StudentHome extends Component {
  render() {
    return (
      <React.Fragment>
        <Header />
        <NavBar />
        <Switch>
          <Route path="/login" component={LoginForm}></Route>
          <Route path="/register" component={RegisterFrom}></Route>
          <Route path="/people/:id" component={PersonDetails} />
          <Route path="/products/:id" component={ProductDetails} />
          <Route
            path="/products"
            render={(props) => <Products sortBy="name" {...props} />}
          ></Route>
          <Route path="/about" component={About}></Route>
          <Route path="/not-found" component={NotFound}></Route>
          <Route path="/" exact component={Table}></Route>
          <Redirect to="/not-found" />
        </Switch>
        <StudentInfo />
      </React.Fragment>
    );
  }
}

export default StudentHome;
